import styled from "styled-components";

const colores = {
    borde: "0075FF",
    error: "bb2929",
    exito: "1ed12d"
}

        const Formulario = styled.form`
        display: grid;,
        grid-template-columns: 1fn 1fn;,
        gap: 20px;,
        @media (max-width: 800px){
            grid-template-columns: 1fr;
        }
        `;
export {Formulario};
